import './App.css';
import logo from './Pictures/plogo.png';
import homeScreen from './Pictures/homeScreen.jpg'

import React from "react";
import { useState, useEffect } from "react";
import { Container, Row, Col, Dropdown } from 'react-bootstrap';
import specialEventParkingImage from "./specialEventParkingImage.jpg"
import golfCartServicesImage from "./specialEventParkingImage.jpg"
import logo1 from "./Pictures/logo1.png"
import logo2 from "./Pictures/logo2.png"
import logo3 from "./Pictures/logo3.png"
import logo4 from "./Pictures/logo4.png"
import logo5 from "./Pictures/logo5.png"
import logo6 from "./Pictures/logo6.png"
import logo7 from "./Pictures/logo7.jpg"
import logo8 from "./Pictures/logo8.png"
import logo9 from "./Pictures/logo9.png"
import logo10 from "./Pictures/logo10.png"
import logo11 from "./Pictures/logo11.png"




export function HomePage() {


      const WelcomeSection = () => {
        return (
            <div>
              <div className="header-content">
                <h1>WELCOME TO PENINSULA PARKING</h1>
                <div className="header-separator"></div>
                <p style={{color: 'white'}}>We are an industry leader and trusted partner providing parking solutions of all kinds in the Bay Area. We provide valet service, traffic flow and lot management, shuttle service, and other concierge services for private and public events at homes and venues. Our team has been serving the Bay Area for nearly 20 years, providing top-quality customer service and earning a “Diamond Certified” rating.</p>
              </div>

            </div>
          );
      }
const LogoBar = () => {
    const logos = [logo1, logo2, logo3, logo4, logo5, logo6, logo7, logo8, logo9, logo10, logo11];
    return (
      <div className="logo-bar-container">
        <div className="logo-bar">
          {logos.map((logo, index) => (
            <img key={index} src={logo} alt="Company Logo" />
          ))}
          {/* Repeat the logos for a smoother transition */}
          {logos.map((logo, index) => (
            <img key={'copy-' + index} src={logo} alt="Company Logo" />
          ))}
        </div>
      </div>
    );
  }



  const Image = () => {
    return (
      <div className="main-container">
        <div className="image-container">
          <img style={{}}src={homeScreen} alt="Commercial Services" />
          <div className="image-overlay">

            <div>
              <div className="header-content" >
                <h1>WELCOME TO PENINSULA PARKING</h1>
                <div className="header-separator"></div>
                <h2 style={{color: 'black'}}>We are an industry leader and trusted partner providing parking solutions of all kinds in the Bay Area. We provide valet service, traffic flow and lot management, shuttle service, and other concierge services for private and public events at homes and venues. Our team has been serving the Bay Area for nearly 20 years, providing top-quality customer service and earning a “Diamond Certified” rating.</h2>
              </div>

            </div>


            <a href="/ContactPage">
            <button className="talk-to-us-btn" >Talk to Us</button>
            </a>



          </div>

        </div>

      </div>

    );
}


  const Footer = () => {
        return (
          <footer className="footer">
            <Container>
              <Row>
                <Col md={3} sm={6}>
                  <h5>Peninsula Parking</h5>
                  <p><i className="fas fa-phone"></i> (855) 736-7275</p>
                  <p><i className="fas fa-phone"></i> info@peninsulaparking.com</p>
                  <p><i className="fas fa-phone"></i> 541 Taylor Way Suite 12 </p>
                  <p><i className="fas fa-phone"></i> San Carlos, CA 94070</p>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Services</h5>
                  <ul>
                    <li>Valet Parking</li>
                    <li>Commercial Services</li>
                    {/* Add more services as needed */}
                  </ul>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Company</h5>
                  <ul>
                    <li>Employment</li>
                    <li>About Us</li>
                    <li>Contact Us</li>

                  </ul>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Locations</h5>
                  <ul>
                  <li>North Bay</li>
                        <li>South Bay</li>
                        <li>Greater Area</li>
                    {/* Add more locations as needed */}
                  </ul>
                </Col>
